__NUXT_JSONP__("/resources/software", (function(a,b,c,d){return {data:[{_img:{"/_ipx/q_50,s_40x40/uploads/SMASHLogo.svg":"\u002F_nuxt\u002Fimage\u002Ff15107.svg"}}],fetch:{"Header:0":{navMenuItems:[{title:"Overviews",rowItems:[{title:"About",link:"\u002Foverview\u002Fabout",icon:"ic:round-info"},{title:"Team",link:"\u002Foverview\u002Fteam",icon:"ic:round-people"}],bottomItems:[{title:"News",link:"\u002Fnews",icon:b}]},{title:"Projects",rowItems:[{title:"Spatially Weighted Analysis of Multiscale Processes (SWAMP)",icon:"icon-park-outline:refraction",link:a},{title:"Modeling Urban Disparities and Dynamics (MUDD)",link:a,icon:"maki:city"},{link:a,icon:"bx:bx-network-chart",title:"Spatial Processes Induced on Networks over Time (SPINT)"},{title:"Applied Transit Analytics and Ridership Informatics (ATARI)",link:a,icon:"mdi:train"},{title:"Efficient, Accessible, & Sustainable Infrastructure for Extracting Remotely-sensed (EASIER) Data",link:a,icon:"mdi:satellite-variant"}],bottomItems:[]},{title:"Resources",rowItems:[{title:c,link:d,icon:"eos-icons:software"},{title:"Publications",link:"\u002Fresources\u002Fpublications",subtitle:null,icon:b},{title:"SMAART",link:"\u002Fresources\u002Fsmaart",subtitle:"Spatial Multiscale Analytics, Applied Research, and Technology Seminar",icon:"ic:round-video-library"}],bottomItems:[{title:"Blog",link:"\u002Fblog",icon:"mdi:fountain-pen-tip"}]}],button:{title:"Contact us!",link:"\u002Fcontact"},mobileMenuOpen:false,branding:{},image:"\u002Fuploads\u002FSMASHLogo.svg"},"PageTitle:0":{content:{slug:"software",title:c,body:"The SMASH team regularly produces and maintains open source software and tools. Below you will find some information about products that are currently available.  \n  \n\n## PySAL Packages\n\nThe Python Spatial Analysis Library (PySAL) is a federation of packages for handling, exploring, analyzing, and visualizing spatial data. For more info, check out the [project web page](https:\u002F\u002Fpysal.org\u002F) and [this paper](https:\u002F\u002Fonlinelibrary.wiley.com\u002Fdoi\u002F10.1111\u002Fgean.12276).\n\n### mgwr\n\nThe **mgwr** package provides an API for geographically weighted regression (GWR) and multiscale geographically weighted regression (MGWR). [Code can be found here](https:\u002F\u002Fgithub.com\u002Fpysal\u002Fmgwr) and a [practical tutorial here](https:\u002F\u002Fwww.mdpi.com\u002F2220-9964\u002F8\u002F6\u002F269\u002Fhtm). Colleagues from SPARC at Arizona State University also maintain a point-and-click [graphic user interface](https:\u002F\u002Fsgsup.asu.edu\u002Fsparc\u002Fmultiscale-gwr) built on top of **mgwr**.\n\n### spint\n\nThe **spint** package provides an API for the calibration of ***sp***atial ***int***eraction models. [Code can be found here](https:\u002F\u002Fgithub.com\u002Fpysal\u002Fspint) and a [practical tutorial here](https:\u002F\u002Fopenjournals.wu.ac.at\u002Fregion\u002Fpaper_175_revised\u002F175.html).\n\n### spglm\n\nThe sparse generalized linear models (**spglm**) package provides an API for generalized linear models that are optimized for sparse design matrices with many zero values. [Code can be found here](https:\u002F\u002Fgithub.com\u002Fpysal\u002Fspglm).\n\n## SIDA Dashboard\n\nThe spatial interaction decision analytics (SIDA) dasboard is prototype of a web-based visualization tool built by our own Matthew Tralka and with assistance from Tyler Hoffman. As a proof-of-concept, it was built entirely using a [reproducible environment](https:\u002F\u002Fgithub.com\u002FGEOSMASH\u002FSIDA) that can be [deployed to the web](https:\u002F\u002Fwww.sida-board.app\u002F) or used locally.\n\n[![SIDA](https:\u002F\u002Fuser-images.githubusercontent.com\u002F8117709\u002F139471983-ff227c50-4aed-44d6-92f5-387700132d08.png)](https:\u002F\u002Fwww.sida-board.app\u002F)",dir:"\u002Fresources",path:d,extension:".yaml",createdAt:"2021-10-16T20:41:44.687Z",updatedAt:"2021-11-01T21:12:21.475Z"}},"data-v-c9de252c:0":{mediaIcons:[{name:"YouTube",icon:"logos:youtube-icon",link:"https:\u002F\u002Fwww.youtube.com\u002F"},{name:"Github",icon:"mdi:github",link:"https:\u002F\u002Fgithub.com\u002FGEOSMASH"}],footerText:"**SMASH 2021**"}},mutations:void 0}}("\u002Fprojects\u002Findex","ic:round-file-copy","Software","\u002Fresources\u002Fsoftware")));